import React from 'react';
import { Terminal } from 'react-terminal';
import './LinuxTerminal.css';

const LinuxTerminal = () => {
  return (
    <div className='terminal'>
      <Terminal
        welcomeMessage="Welcome to my terminal portfolio! Type 'help' for a list of commands."
        commands={{
          help: 'Available commands: whoami, articles, github, linkedin',
          whoami: 'I am a motivated developer passionate about web development and DevOps!',
          github: 'Opening GitHub... (fake link)',
          linkedin: 'Opening LinkedIn... (fake link)',
        }}
      />
    </div>
  );
};

export default LinuxTerminal;
